Filters = {};
Dash = {
  rotate: []
}
Filters.getPixels = function (img) {
  if (img === null) img = document.getElementById('orig');
  var c = this.getCanvas(img.naturalWidth, img.naturalHeight);
  var ctx = c.getContext('2d');
  ctx.drawImage(img, 0, 0);
  return (Filters.rotated) ? Filters.rotate(Filters.rotated) : ctx.getImageData(0, 0, c.width, c.height);
};

Filters.getCanvas = function (w, h) {
  var c = document.createElement('canvas');
  c.width = w;
  c.height = h;
  return c;
};

Filters.filterImage = function (filter, image, var_args) {
  var args = [this.getPixels(image)];
  for (var i = 2; i < arguments.length; i++) {
    args.push(arguments[i]);
  }
  return filter.apply(null, args);
};

Filters.rotate = function (degrees, canvas = document.getElementById("image"), img = document.getElementById("orig")) {
  let ctx = canvas.getContext('2d')
  canvas.width = img.width
  canvas.height = img.height
  ctx.save()
  ctx.translate(canvas.width / 2, canvas.height / 2)
  ctx.rotate(degrees * Math.PI / 180)
  ctx.drawImage(img, -canvas.width / 2, -canvas.height / 2)
  ctx.restore()
  // $(img).hide()
  // $(canvas).show()
  Filters.rotated = degrees
  $("#orig").css("transform", "rotate(" + (degrees || 0) + "deg)")
  return ctx.getImageData(0, 0, canvas.width, canvas.height)
}

function rotato(start, end, interval) {
  while (start < end) {
    Filters.rotated = start
    start += interval / 2
    if (Dash.rotate[Filters.rotated]) continue;
    runFilter('dashblock', Filters.dashblock)
  }
  return console.log(Dash.rotate)
}

Dash.align = function (start = -3, end = 3, interval = 1, limit = 0.125) {
  let lowest = {}
  while (interval >= limit) {
    rotato(start, end, interval)
    Object.keys(Dash.rotate).forEach(function (k) {
      if (lowest.rowSigma && lowest.rowSigma < Dash.rotate[k].rowSigma || (Dash.rotate[k].rowSigma === -Infinity)) {
        return
      }
      lowest = Dash.rotate[k]
      lowest.rotation = k
    })
    start = Number(lowest.rotation) - interval
    end = Number(lowest.rotation) + interval
    interval /= 2
  }
  alert(lowest.rotation + " degrees seems to be the thing.")
}

