Filters.dashblock = function (pixels, threshold) {
  var resolution = CONFIG.resolution = parseInt(document.getElementById("resolution").value); // in each direction: MUST be Integer > 0
  var width = pixels.width;
  var channel = CONFIG.channel = parseInt(document.getElementById("channel").value); // 0,1,2 RGB
  var d = pixels.data;
  var blocks = [];
  var r = resolution;
  var aRow = 4 * width;
  for (i = (8 + aRow) * resolution; i < d.length - 4 * resolution; i += 8 * resolution) {
    if ((i - r * aRow) > aRow) {
      //skip a row
      r += resolution * 2;
      i = r * aRow + 8;
    }
    var rgb = channel ? 3 * d[i + channel] : d[i] + d[i + 1] + d[i + 2]; // right pixel
    var comprgb = channel ? 3 * d[i - 4 * resolution + channel] : d[i - 4 * resolution + 0] + d[i - 4 * resolution + 1] + d[i - 4 * resolution + 2]; //left pixel
    //if (Math.abs(rgb - comprgb) > threshold) {
    // visualize boxes
    //}
    // print all for now
    var newVal = Math.floor(Math.abs(rgb - comprgb) / 1);
    if (newVal > 255) {
      newVal = 255;
    }
    if (blocks[(r - 1) / 2]) { // build matrix of values
      blocks[(r - 1) / 2].push(newVal);
    } else {
      blocks[(r - 1) / 2] = [newVal];
    }
    for (col = -resolution; col < resolution; col++) {
      for (row = -resolution; row < resolution; row++) {
        d[i + row * aRow + col * 4] = d[i + row * aRow + col * 4 + 1] = d[i + row * aRow + col * 4 + 2] = 255 - newVal;
      }
    }
  }

  if (CONFIG.lines || CONFIG.overlay || CONFIG.textbox) {
    let iW = $("#image").attr("width")
    let iH = $("#image").attr("height")
    let filteredBlocks = blocks.filter(s => typeof s === "object" && !isNaN(s[0]))

    let columnArray = []
    let b = filteredBlocks[0].length
    while (--b > -1) {
      filteredBlocks.forEach(function (arr) {
        let v = arr[b]
        if (isNaN(v)) return
        columnArray[b] = columnArray[b] ? columnArray[b] + v : v
      })
    }
    let cols = $()
    let covs = $()
    let maxH = columnArray.max()
    let rowArray = filteredBlocks.sumRows()
    // d3.select("#rows").selectAll("div").data(rowArray).enter().append("div")
    // .style("height",function(d){d/Math.max(rowArray)+"%";}).attr("title",d).text(d)
    let bars = $()
    let bovs = $()
    let maxW = rowArray.max()

    let lines = []
    let stripes = [] // incoming [ {x,y,w,h} ]

    columnArray.forEach(function (d) {
      cols = cols.add($("<div>").attr("title", d).height(d / maxH * 100 + "%"))
      covs = covs.add($("<div>").attr("title", d).css("opacity", d / maxH))
    })
    if (CONFIG.histograms || CONFIG.overlay || CONFIG.textbox || CONFIG.lines) {
      $("#columns, #cOverlay, #rOverlay, #rows").empty()
    }
    if (CONFIG.histograms) {
      $("#columns").width(iW).append(cols)
      $("#columns").children().width(100 / cols.size() + "%")
    }
    if (CONFIG.overlay) {
      $("#cOverlay").width(iW).height(iH).append(covs)
      $("#cOverlay").children().width(100 / covs.size() + "%").height(iH)
    }
    if (CONFIG.textbox) {
      const COL_SUM = columnArray.reduce((previous, current) => current += previous)
      const COL_AVG = COL_SUM / columnArray.length
      const COL_MEDIAN = columnArray.concat().sort()[Math.floor(columnArray.length / 2)]
      const COL_TH = Math.floor(maxH * CONFIG.threshold.column)
      const ROW_TH = Math.floor(maxW * CONFIG.threshold.row)
      let proposedColumnsX = [];
      $("#columns").children().each(function (index) {
        if ($(this).height() > (COL_TH / maxH * 100)) {
          columnArray[index].inCol = true
          proposedColumnsX.push(index)
          $(this).css("background-color", "black")
        }
      })
      $("#cOverlay").children().each(function () {
        if ($(this).css("opacity") > (COL_TH / maxH)) {
          $(this).css("background-color", "black")
        }
      })

      // detect: {
      //   column: {
      //     minimum: .05, // % of width
      //     gapX: .01, // % of width to bridge
      //     gapY: .05 // % of height to bridge
      //   },
      //   row: {
      //     minimum: .01 // % of height
      //   }
      // }
      // assert columns on vertical data only
      let clen = columnArray.length
      let gapX = CONFIG.detect.column.gapX * clen
      let gapY = CONFIG.detect.column.gapY * clen
      let colMin = CONFIG.detect.column.minimum * clen
      let rowMin = CONFIG.detect.row.minimum * iH
      let rowMax = CONFIG.detect.row.maximum * iH
      while (proposedColumnsX.length) {
        let colStart = proposedColumnsX.pop()
        let test = colStart.valueOf()
        let inCol = true
        while (inCol && proposedColumnsX.length) {
          let next = proposedColumnsX.pop()
          if (test - next < gapX) {
            test = next.valueOf()
            continue
          }
          if (colStart - test > colMin) {
            stripes.unshift({
              x: test,
              y: undefined,
              w: colStart - test,
              h: undefined
            })
          }
          inCol = false
        }
      }

      console.log(stripes)
      let proposedRowsY = [];

      stripes.forEach(function (c, index) {
        let theseRows = []
        let rArray = filteredBlocks.sumRows(c.x, c.x + c.w)
        while (rArray.length) {
          let test = rArray.pop()
          if (test < ROW_TH) {
            continue
          }
          let rowStart = rArray.length + 1
          let inRow = true
          while (inRow && rArray.length) {
            let next = rArray.pop()
            if (next < ROW_TH) {
              inRow = false
              // end row
              let rSize = rowStart - rArray.length
              if (rSize < rowMax && rSize > rowMin) {
                // write row
                let y = rArray.length + 1
                let h = rowStart - y
                theseRows.push({
                  x: c.x,
                  y: y,
                  w: c.w,
                  h: h
                })
              }
            }
          }
        }
        // TODO: Divide by gapY to break into several columns
        if (theseRows.length > CONFIG.detect.column.minRows) {
          lines.push(theseRows)
        }
      })
      Dash.rotate[Filters.rotated || 0] = {
        maxColumnWidth: lines.map(line => line.max("w")).max(),
        rowCount: lines.map(l => l.length).max(),
        rowAvgHeight: lines.map(line => line.avg("h")).max(),
        rowSigma: lines.map(line => line.σ("h")).max()
      }
      lines.forEach(function (line, index) {
        let last = line[line.length - 1]
        let css = {
          left: last.x / iW * 2 * CONFIG.resolution * 100 + "%",
          top: last.y / iH * 2 * CONFIG.resolution * 100 + "%",
          width: last.w / iW * 2 * CONFIG.resolution * 100 + "%",
          height: (line[0].y + line[0].h - last.y) / iH * 2 * CONFIG.resolution * 100 + "%",
          border: "2px solid lime",
          background: "transparent",
          position: "absolute"
        }
        $("#cOverlay").width(iW).height(iH).append($("<div>").attr("title", String.fromCharCode(index + 65)).css(css))
      })
      // TODO: confirm row-like behavior and save
      // TODO: render
    }
    if (CONFIG.lines) {
      lines.forEach(function (line, index) {
        line.forEach(function (ln, ind) {
          let css = {
            left: ln.x / iW * 2 * CONFIG.resolution * 100 + "%",
            top: ln.y / iH * 2 * CONFIG.resolution * 100 + "%",
            width: ln.w / iW * 2 * CONFIG.resolution * 100 + "%",
            height: ln.h / iH * 2 * CONFIG.resolution * 100 + "%",
            border: "thin solid orange",
            position: "absolute"
          }
          $("#cOverlay").width(iW).height(iH).append($("<div>").attr("title", String.fromCharCode(index + 65)).css(css))
        })
      })
      // TODO: count and avg lines
      // TODO: render
    }

    rowArray.forEach(function (d) {
      bars = bars.add($("<div>").attr("title", d).width(d / maxW * 100 + "%"))
      bovs = bovs.add($("<div>").attr("title", d).css("opacity", d / maxW))
    })
    if (CONFIG.histograms) {
      $("#rows").height(iH).append(bars)
      $("#rows").children().height(100 / bars.size() + "%")
    }
    if (CONFIG.overlay) {
      $("#rOverlay").width(iW).height(iH).append(bovs)
      $("#rOverlay").children().height(100 / bovs.size() + "%").width(iW)
    }
    if (CONFIG.textbox) {
      const ROW_SUM = rowArray.reduce((previous, current) => current += previous)
      const ROW_AVG = ROW_SUM / rowArray.length
      $("#rows").children().each(function (index) {
        if ($(this).width() > (ROW_AVG / maxW * 100)) {
          rowArray[index].inRow = true
        }
      })
      $("#rOverlay").children().each(function () {
        if ($(this).css("opacity") > (ROW_AVG / maxW)) {
          $(this).css("background-color", "black")
        }
      })
    }
    if (CONFIG.lines) {}
  }
  // console.log(blocks);

  return pixels;
};

Array.prototype.sumRows = function (columnStart = 0, columnEnd = this.length) {
  return this.map(r => r.slice(columnStart, columnEnd).reduce((a, b) => a + b))
}
Array.prototype.max = function (prop) {
  if (prop) {
    let max;
    try {
      this.forEach(function (e) {
        if (e[prop] > max) max = e[prop]
        else if (max === undefined && !isNaN(e[prop])) max = e[prop]
      })
    } catch (err) {
      throw new Error("Property not found.", err)
    }
    return max
  }
  return Math.max(...this)
}
Array.prototype.avg = function (prop) {
  if (prop) {
    let flist = this.filter(x => !isNaN(x[prop]))
    return flist.reduce((a, b) => a + b[prop], 0) / flist.length
  }
  return this.reduce((a, b) => a + b, 0) / this.length
}
Array.prototype.σ = function (prop) {
  let mean = this.avg(prop)
  if (prop) {
    return Math.sqrt(this.map(e => Math.pow((e[prop] - mean), 2)).avg())
  }
  return Math.sqrt(this.map(e => Math.pow((e - mean), 2)).avg())
}

Filters.grayscale = function (pixels, args) {
  var d = pixels.data;
  for (var i = 0; i < d.length; i += 4) {
    var r = d[i];
    var g = d[i + 1];
    var b = d[i + 2];
    // CIE luminance for the RGB
    var v = 0.2126 * r + 0.7152 * g + 0.0722 * b;
    d[i] = d[i + 1] = d[i + 2] = v
  }
  return pixels;
};
var img = document.getElementById('orig');

function runFilter(id, filter, arg1, arg2, arg3) {
  var c = document.getElementById('image');
  var s = c.previousElementSibling.style;
  var b = document.getElementById('button' + id);
  if (b.originalText === undefined) {
    b.originalText = b.textContent;
  }
  if (s.display == 'none') {
    s.display = 'inline';
    c.style.display = 'none';
    b.textContent = b.originalText;
  } else {
    var idata = Filters.filterImage(filter, img, arg1, arg2, arg3);
    c.width = idata.width;
    c.height = idata.height;
    var ctx = c.getContext('2d');
    ctx.putImageData(idata, 0, 0);
    s.display = 'none';
    c.style.display = 'inline';
    b.textContent = 'Restore original image';
  }
}

function updateURL(url) {
  if (!url) {
    url = "data:image/jpeg;base64,";
  }
  document.getElementById('orig').src = url;
}

